"use strict";

/*
ORDEM DE IMPORTANCIA 
() >>> ** >>> * / % >>> + - 

+  adição/ concatenação
-  subtração
/  divisão
*  multiplicação
** potenciação
% resto da divisão

*/
var num = 10;
var num2 = 3;
console.log(num + num2);
console.log(num - num2);
console.log(num / num2);
console.log(num * num2);
console.log(Math.pow(num, num2));
console.log(num % num2);